import React from "react";
import { NavLink } from "react-router-dom";

export default function Header() {  
    return (
        <div className="header">
            <div className="nav container">
                <div className="logo-container">
                    <img src="https://aster-imgs.s3.amazonaws.com/logo.png" alt="logo" />
                </div>
                <ul className="menu">
                    <li><NavLink to="/" exact="true">HOME</NavLink></li>
                    <li><NavLink to="/reservation" exact="true">RESERVATION</NavLink></li>
                    <li><NavLink to="/gallery" exact="true">GALLERY</NavLink></li>
                    <li className="login-link"><NavLink to="/login" exact="true">LOGIN</NavLink></li>
                </ul>
            </div>
        </div>
    )
}
